def main():
    """ Outputs up to the 3030th Fibonacci number before reading unknown. """
    white = "\u001b[37m"
    green = "\u001b[32m"
    yellow = "\u001b[33;1m"
    prev = 0
    curr = 1
    i = 0

    num = int(input(" Enter Number: "))
    assert num > 0, "Enter Positive Integer Greater Than 0"

    print("\n")
    for i in range(0, num):

        d = big_numbers()

        for k, v in d.items():
            if curr >= v:
                num_name = k

        title = ' Fibonacci Number {}. Located in the {}{}'.format(i + 1, green, num_name)
        fib_num = '{} {:,}{}\n'.format(yellow, curr, white)

        new_num = prev + curr
        prev = curr
        curr = new_num
        i += 1

    print(title)
    print(fib_num)


if __name__ == "__main__":
    main()
